  const allModels: any = {
    BMW: ['X1', 'X2', 'X3', 'X4', 'X5', 'X6', 'X7'],
    Honda: ['Accord', 'Civic'],
    Tesla: ['Model S', 'Model 3', 'Model X', 'Model Y', 'Cybertruck'],
