    return {
      context: {},
      defaultColDef: this.getDefaultColDef(),
      getRowId: (params) => {
        return String(params.data['id']);
      },
      rowSelection: {
        mode: 'singleRow',
      },
      undoRedoCellEditing: true,
    };
  };

  clientSide = (): GridOptions => {
    return {
      ...this.core(),
      rowModelType: 'clientSide',
    };
  };

  serverSide = (): GridOptions => {
    return {
      ...this.core(),
      rowModelType: 'serverSide',
    };
  };
}

